import "./App.css";
import { BrowserRouter as Router, Route } from "react-router-dom";
import About from "./About";
import Home from "./Home";

function App() {
  return (
    <Router>
      <routes>
      <Route path="/">
        <Home />
      </Route>

      <Route path="/about">
        <About />
      </Route>
      </routes>
    </Router>
  );
}

export default App;
